import React from "react";
import '../App.css';
import Dropdown from 'react-dropdown';
import 'react-dropdown/style.css';

const gender = [
  'select', 'Male', 'Female', 'Other'
];
const options = {
  gender: ['select', 'Male', 'Female', 'Other'],
  boolean: ['Yes', 'No'],
  education: [
    'Less than high school',
    'High School',
    'University Degree',
    'Graduate Degree']
}

const defaultOption = gender[0];
class Demographic extends React.Component {

  render() {
    return (      
      <div>

        <h1>PERSONAL INFORMATION</h1>
        {/* <div className="wallpaper">
        </div> */}
        <div>
          <ul>
            <li>What is your gender?</li>
            <Dropdown options={gender} onChange={this._onSelect} value={defaultOption} placeholder="Select an option" />
            <li>Is English your native language?</li>
            <Dropdown options={gender} onChange={this._onSelect} value={defaultOption} placeholder="Select an option" />
            <li>What is your gender?</li>
            <Dropdown options={gender} onChange={this._onSelect} value={defaultOption} placeholder="Select an option" />
            <li>What is your gender?</li>
            <Dropdown options={gender} onChange={this._onSelect} value={defaultOption} placeholder="Select an option" />
          </ul>
        </div>



<form onSubmit={this.handleSubmit}>

<div className="prompt">
  <h4>What led up to the event depicted?</h4>
  <textarea 
    type="text" 
    className="text-field"
    name="past"
    // value={this.state.value} 
    // onChange={this.handleChange} 
  />
  <h4>What is happening at the moment?</h4>
  <textarea 
    name="present"
    type="text" 
    className="text-field"
    // value={this.state.value} 
    // onChange={this.handleChange} 
  />
  <h4>If you attended a university, what was your major (e.g. "psychology", "English", "civil engineering")?</h4>
  <textarea 
    name="feelings"
    type="text" 
    className="text-field"
    // value={this.state.value} 
    // onChange={this.handleChange} 
  />
  <h4>What will be a likely outcome?</h4>
  <textarea 
    name="future"
    type="text" 
    className="text-field"
    // value={this.state.value} 
    // onChange={this.handleChange} 
  />
  <button className="btn btn-default tat-submit" onClick={this.save}>Submit</button>
</div>
</form>


      </div>
    );
  }
}

export default Demographic;




